// frontend/src/pages/SeeTrips.js
import React, { useState, useEffect } from 'react';
import sendFormSql from '../services/SendFormSql';

const SeeTrips = () => {
  const [trips, setTrips] = useState([]);

  const fetchTrips = async () => {
    const data = await sendFormSql.getTrips();
    setTrips(data);
  };

  const handleDelete = async (id) => {
    await sendFormSql.deleteTrip(id); // Llamada para eliminar
    fetchTrips(); // Recargar los viajes
  };

  const handleEdit = async (id) => {
    // Lógica para navegar a EditTrip
  };

  useEffect(() => {
    fetchTrips();
  }, []);

  return (
    <div>
      <h2>Consultar Viajes</h2>
      <table>
        <thead>
          <tr>
            <th>País</th>
            <th>Año</th>
            <th>Mes</th>
            <th>Duración</th>
            <th>Costo</th>
            <th>Km Recorridos</th>
            <th>Hotel</th>
            <th>Acciones</th>
          </tr>
        </thead>
        <tbody>
          {trips.map(trip => (
            <tr key={trip.id}>
              <td>{trip.country}</td>
              <td>{trip.year}</td>
              <td>{trip.month}</td>
              <td>{trip.duration}</td>
              <td>{trip.cost}</td>
              <td>{trip.km_travelled}</td>
              <td>{trip.hotel}</td>
              <td>
                <button onClick={() => handleDelete(trip.id)}>Eliminar</button>
                <button onClick={() => handleEdit(trip.id)}>Modificar</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default SeeTrips;
